import React from "react";

import styled from "styled-components";


function NavBar () {
    const Header = styled.section`
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;
        justify-content: space-between;
        background-color: #FFFCF7;
        margin: -9px;
    `
    const Name = styled.h2`
        font-family: 'Vollkorn', serif;
        color: #738290;
        margin: 2%;
    `
    const Links = styled.section`
        margin: 3%;
        display: flex;
        flex-direction: row;
        justify-content: space-between;
    `
    const Link = styled.a`
        font-family: 'Vollkorn', serif;
        display: flex;
        margin: 2%;
        color: #738290;
    `
    return (
        <Header>
            <Name>Rebecca Barrett</Name>
            <Links>
                <Link>Projects |</Link>
                <Link>Contact</Link>
            </Links>
        </Header>

    )
}

export default NavBar;
